(0004, 'Learning Area', 'Science', 'SCI', 'Sciences', '', ''),
(0005, 'Learning Area', 'The Arts', 'TA', 'Art, Dance, Drama, Media, Music', '', ''),
(0006, 'Learning Area', 'Humanities', 'HUM', 'Humanities, PSHE, Economics, Religious Studies, Environmental Management', '', ''),
(0007, 'Learning Area', 'English', 'ENG', 'English, English as an Additional Language', '', ''),
(0008, 'Learning Area', 'Languages', 'LNG', 'Chinese First Language, Chinese Second Language, Japanese, Spanish', '', ''),
(0010, 'Learning Area', 'Physical Education', 'PE', 'Physical Education', '', ''),
(0011, 'Administration', 'Finance', 'FIN', '', '', ''),
