INSERT INTO `gibbonLibraryItem` (`gibbonLibraryItemID`, `gibbonLibraryTypeID`, `id`, `name`, `producer`, `fields`, `vendor`, `purchaseDate`, `invoiceNumber`, `imageType`, `imageLocation`, `comment`, `gibbonSpaceID`, `locationDetail`, `ownershipType`, `gibbonPersonIDOwnership`, `gibbonDepartmentID`, `replacementCost`, `gibbonSchoolYearIDReplacement`, `borrowable`, `status`, `gibbonPersonIDStatusResponsible`, `gibbonPersonIDStatusRecorder`, `timestampStatus`, `returnExpected`, `returnAction`, `gibbonPersonIDReturnAction`, `gibbonPersonIDCreator`, `timestampCreator`, `gibbonPersonIDUpdate`, `timestampUpdate`) VALUES
(0000000006, 00004, '03535', 'Tender Is the Night', 'F. Scott Fitzgerald', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:16:"Penguin Classics";s:16:"Publication Date";s:4:"1997";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0140622608";s:6:"ISBN13";s:13:"9780140622607";s:11:"Description";s:420:"To the French Riviera come Dick and Nicole Diver. Handsome, rich and glamorous, their dinners are legendary, their atmosphere magnetic. But something is wrong - Nicole has a secret and Dick a weakness. Together they head towards the rocks on which their lives crash - and only one of them really survives. Fitzgerald worked on seventeen versions of this novel, the obsessions of which consumed his marriage and his life.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"392";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=jbZgQgAACAAJ&dq=isbn:9780140622607&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=jbZgQgAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F FIT)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000810, '2015-04-23 13:11:07', NULL, '', NULL, 0000000823, '2012-10-04 16:13:57', 0000000823, '2012-10-30 10:38:46'),
(0000000009, 00004, '03518', 'Animal Farm', 'George Orwell, Russell Baker, Christopher Montague Woodhouse', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:15:"Signet Classics";s:16:"Publication Date";s:4:"1996";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0451526341";s:6:"ISBN13";s:13:"9780451526342";s:11:"Description";s:217:"Featuring a new preface, this classic satire on totalitarianism in which farm animals overthrow their human owner and set up their own government is once again brought to life for a new generation of readers. Reissue.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"140";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:0:"";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=SGAZdjNfruYC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Class Read 3', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000689, '2015-09-17 15:35:50', NULL, '', NULL, 0000000823, '2012-10-05 08:14:04', 0000000689, '2015-12-08 14:54:43'),
(0000000005, 00004, '03538', 'Howards End', 'E. M. Forster, Regina Marler, Benjamin DeMott', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:14:"Signet Classic";s:16:"Publication Date";s:10:"06/11/2007";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0451530462";s:6:"ISBN13";s:13:"9780451530462";s:11:"Description";s:132:"The classic novel explores the divisions of culture and class in late-Victorian England through the story of a disputed inheritance.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"281";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=iaVLeokzxFIC&dq=isbn:9780451530462&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=iaVLeokzxFIC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F FOR)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000823, '2012-10-04 16:07:24', NULL, '', NULL, 0000000823, '2012-10-04 16:04:08', 0000000823, '2012-10-30 10:30:05'),
