(0000000010, 00004, '04011', 'The Good Soldier vejk', 'Jaroslav Haek', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:16:"Penguin Classics";s:16:"Publication Date";s:10:"01/12/2005";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0140449914";s:6:"ISBN13";s:13:"9780140449914";s:11:"Description";s:809:"In The Good Soldier Svejk, celebrated Czech writer and anarchist Jaroslav Hasek combined dazzling wordplay and piercing satire in a hilariously subversive depiction of the futility of war. Good-natured and garrulous, Svejk becomes the Austrian army''s most loyal Czech soldier when he is called up on the outbreak of World War Ialthough his bumbling attempts to get to the front serve only to prevent him from reaching it. Playing cards and getting drunk, he uses all his cunning and genial subterfuge to deal with the police, clergy, and officers who chivy him toward battle. Cecil Parrott''s vibrant translation conveys the brilliant irreverence of this classic about a hapless Everyman caught in a vast bureaucratic machine. Brilliant . . . Perhaps the funniest novel ever written. George Monbiot";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"752";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=A1hgPQAACAAJ&dq=isbn:9780140449914&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=A1hgPQAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F HAS)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000810, '2014-03-27 08:50:13', NULL, '', NULL, 0000000823, '2012-10-05 08:16:23', 0000000823, '2012-10-30 10:09:57'),
(0000000011, 00004, '06904', 'Pride and Prejudice', 'Jane Austen, Meg Cabot', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:18:"Bloomsbury Pub Ltd";s:16:"Publication Date";s:10:"05/03/2007";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0747587485";s:6:"ISBN13";s:13:"9780747587484";s:11:"Description";s:127:"Elizabeth Bennet''s chances of happiness are endangered by the foibles of human nature in this classic nineteenth-century novel.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"352";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=tigfAAAACAAJ&dq=isbn:9780747587484&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=tigfAAAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F AUS)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000810, '2014-10-28 14:26:04', NULL, '', NULL, 0000000823, '2012-10-05 08:18:51', 0000000823, '2012-11-07 11:42:37'),
(0000000012, 00004, '01139', 'The Grapes of Wrath', 'John Steinbeck', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:8:"ePenguin";s:16:"Publication Date";s:10:"26/04/2001";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0140292926";s:6:"ISBN13";s:13:"9780140292923";s:11:"Description";s:598:"Shocking and controversial when it was first published in 1939, Steinbeck''s Pulitzer Prize-winning epic remains his undisputed masterpiece. Set against the background of dust bowl Oklahoma and Californian migrant life, it tells of the Joad family, who, like thousands of others, are forced to travel West in search of the promised land. Their story is one of false hopes, thwarted desires and broken dreams, yet out of their suffering Steinbeck created a drama that is intensely human yet majestic in its scale and moral vision; an eloquent tribute to the endurance and dignity of the human spirit.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"544";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=rK34BBMEnoAC&dq=isbn:9780140292923&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=rK34BBMEnoAC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F STE)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000810, '2015-01-16 08:34:38', NULL, '', NULL, 0000000823, '2012-10-05 08:20:18', 0000000823, '2012-10-30 10:10:47'),
(0000000013, 00004, '04986', 'COMPLETE FAIRY TALES, THE', 'Jacob W. Grimm, IRMAOS GRIMM, Wilhelm K. Grimm', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:0:"";s:16:"Publication Date";s:10:"20/05/2009";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"1840221747";s:6:"ISBN13";s:13:"9781840221749";s:11:"Description";s:647:"Jacob Grimm (1785-1863) and his brother Wilhelm (1786-1859) were philologists and folklorists. The brothers rediscovered a host of fairy tales, telling of princes and princesses in their castles, witches in their towers and forests, of giants and dwarfs, of fabulous animals and dark deeds. Together with the well-known tales of ''Rapunzel'', ''The Goose-Girl'', ''Sleeping Beauty'', ''Hansel and Gretel'' and ''Snow White'', there are the darker tales such as ''Death''s Messengers'' which deserve to be better known, and which will appeal not only to allwho are interested in the history of folklore, but also to all those who simply love good story-telling.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"848";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=gxKcPwAACAAJ&dq=isbn:9781840221749&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=gxKcPwAACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F GRI)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000689, '2015-12-07 12:06:58', NULL, '', NULL, 0000000823, '2012-10-05 08:23:52', 0000000823, '2012-10-30 10:09:43'),
