(0000000020, 00004, '00718', 'The War of the Worlds', 'H. G. Wells', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:5:"Aerie";s:16:"Publication Date";s:10:"01/12/1993";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0812505158";s:6:"ISBN13";s:13:"9780812505153";s:11:"Description";s:807:"Tor Classics are affordably-priced editions designed to attract the young reader. Original dynamic cover art enthusiastically represents the excitement of each story. Appropriate "reader friendly" type sizes have been chosen for each titleoffering clear, accurate, and readable text. All editions are complete and unabridged, and feature Introductions and Afterwords. This edition of War of the Worlds includes a Introduction, Biographical Note, and Afterword by James Gunn. They came form outer space--Mars, to be exact. With deadly heat-rays and giant fighting machine they want to conquer Earth and keep humans as their slaves. Nothing seems to stop them as they spread terror and death across the planet. It is the start of the most important war in Earth''s history. And Earth will never be the same.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"224";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=uOB2fMgynp8C&dq=isbn:9780812505153&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=uOB2fMgynp8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '', 00013, 'Classics (F WEL)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, NULL, NULL, NULL, NULL, NULL, 0000000823, '2012-10-05 08:36:05', 0000000823, '2012-10-30 10:04:19'),
(0000000022, 00004, '03516', 'The Time Machine', 'H. G. Wells', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:15:"Signet Classics";s:16:"Publication Date";s:10:"01/10/2002";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0451528557";s:6:"ISBN13";s:13:"9780451528551";s:11:"Description";s:238:"A classic novel of the future follows the Time Traveller as he hurtles one million years into the future and encounters a world populated by two distinct races, the childlike Eloi and the disgusting Morlocks who prey on the Eloi. Reprint.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"144";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=QheiKTNdrQoC&dq=isbn:9780451528551&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=QheiKTNdrQoC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classic (F WEL)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, 0000000810, '2013-12-19 10:15:58', NULL, '', NULL, 0000000823, '2012-10-05 08:40:37', 0000000823, '2012-10-30 10:03:19'),
(0000000023, 00004, '04042', 'Oliver Twist', 'Les Martin, Charles Dickens', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:36:"Random House Books for Young Readers";s:16:"Publication Date";s:10:"18/08/1990";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"0679803912";s:6:"ISBN13";s:13:"9780679803911";s:11:"Description";s:241:"Oliver Twist is a desperate orphan. A gang of thieves takes him in and teaches him to steal, but then he is caught. What will become of poor Oliver Twist? Kids can find out in this easy-to-read chapter book adaptation of the Dickens classic.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:2:"96";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:83:"http://books.google.com/books?id=snf7_yN2PWQC&dq=isbn:0679803912&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=snf7_yN2PWQC&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F DIC)', '', NULL, NULL, NULL, NULL, 'Y', 'Available', NULL, NULL, NULL, NULL, NULL, NULL, 0000000823, '2012-10-05 08:43:13', 0000000823, '2012-10-30 10:07:51'),
