(0000000025, 00004, '00970', 'Nineteen Eighty-Four', 'George Orwell', 'a:20:{s:6:"Format";s:4:"Book";s:9:"Publisher";s:8:"ePenguin";s:16:"Publication Date";s:10:"29/01/2004";s:22:"Country of Publication";s:0:"";s:7:"Edition";s:0:"";s:6:"ISBN10";s:10:"014118776X";s:6:"ISBN13";s:13:"9780141187761";s:11:"Description";s:521:"Hidden away in the Record Department of the sprawling Ministry of Truth, Winston Smith skilfully rewrites the past to suit the needs of the Party. Yet he inwardly rebels against the totalitarian world he lives in, which demands absolute obedience and controls him through the all-seeing telescreens and the watchful eye of Big Brother, symbolic head of the Party. In his longing for truth and liberty, Smith begins a secret love affair with a fellow-worker Julia, but soon discovers the true price of freedom is betrayal.";s:8:"Subjects";s:0:"";s:10:"Collection";s:18:"Fiction - Classics";s:14:"Control Number";s:0:"";s:20:"Cataloging Authority";s:0:"";s:21:"Reader Age (Youngest)";s:0:"";s:19:"Reader Age (Oldest)";s:0:"";s:10:"Page Count";s:3:"400";s:6:"Height";s:0:"";s:5:"Width";s:0:"";s:9:"Thickness";s:0:"";s:8:"Language";s:2:"en";s:4:"Link";s:86:"http://books.google.com/books?id=BjSbO-pY5t8C&dq=isbn:9780141187761&hl=&source=gbs_api";}', '', NULL, '', 'Link', 'http://books.google.com/books?id=BjSbO-pY5t8C&printsec=frontcover&img=1&zoom=1&source=gbs_api', '', 00013, 'Classics (F ORW)', '', NULL, NULL, NULL, NULL, 'Y', 'On Loan', 0000000549, 0000000810, '2015-01-30 11:26:59', '2015-02-13', '', NULL, 0000000823, '2012-10-05 08:46:57', 0000000823, '2012-10-30 10:03:05'),
