(00000002, 'Working With Information', 'ICT-Info', 'ICT', 'Developing skills in finding, understanding, analysing, judging, improving and synthesizing digital information.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000003, 'Conceptual Understanding', 'ICT-Conc', 'ICT', 'Developing ability to understand and analyse abstract concepts, whilst developing links between different areas.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000004, 'Technical Ability', 'ICT-Tech', 'ICT', 'Developing willingness and ability to use a range of tools, hardware, software, and understanding how they work together to create functional systems. Developing skills in troubleshooting and problem solving.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000005, 'Communication', 'ICT-Comm', 'ICT', 'Developing communication skills across a range of media (online and real world), learning to relate to a range of audiences for a variety of purposes.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000006, 'Creating Solutions', 'ICT-Solv', 'ICT', 'Learning to combine tools to create solutions, leading up to the ability to work for real clients on real clients.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000007, 'Controlling Machines', 'ICT-Mach', 'ICT', 'Understanding how machines (including computers) are controlled, and how software can be developed to achieve this.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000008, 'Humans & Technology', 'ICT-Humn', 'ICT', 'Understanding the importance of technology in being human, and the way this is rapidly changing through developments in the field of ICT.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000009, 'Getting Work Done', 'ICT-Work', 'ICT', 'Learning to work independently and in collaboration with others in order to move forward in open-ended tasks with diminishing teacher guidance', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000010, 'Intellectual Property', 'ICT-IP', 'ICT', 'Learning to appreciate the value of intellectual property and its protection, whilst knowing that sharing leads to creativity and progress. Developing a desire to create and share meaningful work with others.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
(00000011, 'Critical Thinking', 'ICT-Crit', 'ICT', 'Learning to see links between units and subjects. Considering causes, effects and implications of phenomena, whilst using them to make predictions.', 'N', 'Learning Area', 0017, '001,002,003', 00000001),
