(00000220, 'Unit 6 - Lines, Angles and Polygons', 'Y7 Geometry', 'LS Maths', '! measure and construct angles up to 360o using a protractor, and classify them as acute, right, obtuse, straight or reflex angles  \r\n! identify triangles (i.e., acute, right, obtuse, scalene, isosceles, equilateral), and classify them according to angle and side properties \r\n! construct triangles, using a variety of tools (e.g, protractor, compass, dynamic geometry software), given acute or right angles and side measurements  \r\n! identify and compare different types of quadrilaterals (i.e., rectangle, square, trapezium, parallelogram, rhombus) \r\n! sort and classify triangles and quadrilaterals by geometric properties related to symmetry, angles, and sides, through investigation using a variety of tools and strategies (e.g., using charts, using Venn diagrams)  \r\n! determine, through investigation using a variety of tools (e.g., dynamic geometry software, concrete materials, protractor) and strategies, the angle relationships for intersecting lines and the sum of the angles of a triangle  \r\n! solve angle-relationship problems involving triangles (e.g., finding interior angles or complementary angles), intersecting lines (e.g., finding supplementary angles or opposite angles) \r\n! investigate and describe applications of geometric properties (e.g., properties of triangles and quadrilaterals) in the real world \r\nEXTENDED EXPECTATIONS\r\n   \r\n! construct angle bisectors and perpendicular bisectors, using a variety of tools (e.g., dynamic geometry software, compass) and strategies (e.g., paper folding), and represent equal angles and equal lengths using mathematical notations \r\n! determine, through investigation using a variety of tools (e.g., dynamic geometry software, concrete materials, protractor) and strategies, the angle relationships for parallel lines and transversals  \r\n! solve angle-relationship problems involving parallel lines and transversals (e.g., finding alternate angles or corresponding angles) ', 'Y', 'Learning Area', 0016, '001,002,003', 00000866),
