(00000236, 'Unit 6 - Mensuration', 'Y8 Mensuration', 'LS Maths', '	interpret and use bearings to specify direction \r\n	choose and use appropriate units and measuring instruments \r\n	distinguish between imperial and metric measures  \r\n	solve problems that require conversion between metric units of measure (e.g., millimeters and centimeters, grams and kilograms, milliliters and liters)\r\n	solve problems that require conversion between metric units of area (i.e., square centimeters, square meters)\r\n	determine through investigation using a variety of tools (e.g., concrete materials, dynamic geometry software) and strategies, the relationship for calculating the area of a trapezium, and generalize to develop the formula [i.e., Area = (sum of lengths of parallel sides  height)  2]\r\n	determine through investigation using a variety of tools (e.g., concrete materials, dynamic geometry software) and strategies, the relationships for calculating the circumference and the area of a circle, and generalize to develop the formulas [i.e., Circumference of a circle =   diameter; Area of a circle =   (radius)2]\r\n	solve problems involving the circumference and the area of a circle\r\n	estimate and calculate the area of composite two-dimensional shapes by decomposing into shapes with known area relationships (e.g., rectangle, parallelogram, triangle)\r\n	determine through investigation using a variety of tools and strategies, the relationship between the area of the base and height and the volume of a cylinder, and generalize to develop the formula (i.e., Volume = area of base  height)\r\n', 'Y', 'Learning Area', 0016, '001,002,003', 00000866),
(00000237, 'Unit 7 - Perimeter, Area and Surface Area', 'Y7 SSM', 'LS Maths', '!choose and use appropriate units and measuring instruments\r\n! solve problems that require conversion between metric units of measure (e.g., millimeters\r\nand centimeters, grams and kilograms, milliliters and liters)\r\n! estimate and measure the perimeter and area of regular and irregular polygons, using a\r\nvariety of tools (e.g., grid paper, dynamic geometry software) and strategies\r\n! determine the relationships between the length and width of a rectangle and its area and\r\nperimeter and generalize to develop the formulas [i.e., Area = length  width; Perimeter =\r\n(2  length) + (2  width)]\r\n! develop the formulas for the area of a parallelogram and the area of a triangle, using the\r\narea relationships among rectangles, parallelograms, and triangles\r\n! solve problems involving the estimation and calculation of the areas of triangles and the\r\nareas of parallelograms\r\n! estimate and calculate the area of composite two-dimensional shapes by decomposing\r\ninto shapes with known area relationships (e.g., rectangle, parallelogram, triangle)\r\n! pose and solve meaningful problems that require the ability to distinguish perimeter and\r\narea (e.g., I need to know about area when I cover a bulletin board with construction\r\npaper. I need to know about perimeter when I make the border.)\r\n! solve problems involving the estimation and calculation of the surface area and volume of\r\ntriangular and rectangular prisms\r\nEXTENDED EXPECTATIONS\r\n  ! build three-dimensional models using connecting cubes, given isometric sketches or different views (i.e., top, side, front) of the structure\r\n! determine the relationship between capacity (i.e., the amount a container can hold) and volume (i.e., the amount of space taken up by an object) by comparing the volume of an object with the amount of liquid it can contain (e.g., a bottle has a volume, the space it takes up, and a capacity, the amount of liquid it can hold)\r\n! determine, through investigation using stacked congruent rectangular layers of concrete materials, the relationship between the height, the area of the base, and the volume of a rectangular prism, and generalize to develop the formula (i.e., Volume = area of base  height)', 'Y', 'Learning Area', 0016, '001,002,003', 00000866),
(00000238, 'Unit 8 - Introduction to Algebra', 'Y7 Algebra', 'LS Maths', '!demonstrate an understanding of different ways in which variables are used (e.g., variable as an unknown quantity; variable as a changing quantity)\r\n! translate phrases describing simple mathematical relationships into algebraic expressions (e.g., one more than three times a number can be written algebraically as 1 + 3x or 3x + 1)\r\n! simplify algebraic expressions by collecting like terms and by multiplying a single term over a bracket\r\n! evaluate algebraic expressions by substituting natural numbers for the variables\r\n! determine the solution to a simple linear equation with one variable by using inverse\r\noperations\r\n! solve linear equations that require prior simplification of brackets\r\n! represent linear growing patterns graphically (i.e., make a table of values that shows the\r\nterm number and the term, and plot the coordinates on a graph)\r\nEXTENDED EXPECTATIONS\r\n ! evaluate algebraic expressions by substituting fractions, decimals, and integers for the variables (e.g., evaluate 3x + 4y  2z, where x = 1, y = 0.6, and z = -1)\r\n2\r\n! solve linear equations in which the unknown appears on either side or on both sides of the equation \r\n! derive a formula and change its subject\r\n! develop and represent the general term of a linear growing pattern, using algebraic\r\nexpressions', 'Y', 'Learning Area', 0016, '001,002,003', 00000866);
