(00000000000150, 'Misleading Photos', '', '001,002,003,004,005,006,007', 'HTML', 'Idea', 'Concept', 'ict,photography,photoshop,truth,trust,tok,knowledge,digital,media', '<p>In general we trust photos in a way that we would never trust words: we know that photos can be faked, but we don''t usually question what we see in the media and on the Internet. The resources below look at how photos can be misleading, either through doctoring, creative photography or omission. Digital photography and computer technology make this process much easier and more powerful, but it is important to keep in mind that these exact issues have been relevant since the dawn of the photographic era.</p><ul><li><a href="http://weirdnewsfiles.com/weird-photos/weird-photoshop/best-photoshop-hoaxes-doctoring-history/">Examples of Doctoring</a></li><li><a href="http://www.huffingtonpost.com/2010/07/23/most-outrageously-mislead_n_620182.html#s104088&amp;title=REAL_Hyatt_Regency">Commercially Misleading Photos</a></li><li><a href="http://zombietime.com/reuters_photo_fraud/">Analysis of Reuters Photo Scandal</a></li></ul><p>Of particular interest is the process by which images are "photoshopped" (i.e. digitally manipulated), and just how much transformation is possible. The videos below give an insight into this process (they are accelerated, it really takes much longer to do this, and lots of skill too).</p><p>&nbsp;</p><p><iframe src="http://www.youtube.com/embed/qcVTLyefWKw" frameborder="0" height="315" width="560">&amp;lt;br/&amp;gt;</iframe><br /><br /><iframe src="http://www.youtube.com/embed/aHLpRxAmCrw" frameborder="0" height="380" width="560"></iframe><br /><br /><iframe src="http://www.youtube.com/embed/okuVuab6qlg" frameborder="0" height="285" width="560"></iframe></p> <p>We can look at the impact of misleading photos from different perspectives, including:</p><ul><li><strong>Political</strong> - what might a country gain by manipulating photos of its enemy at war?</li><li><strong>Individual</strong> - how does unrealistically attractive portraits in magazines make me feel?</li><li><strong>Society</strong> - how have misleading photos changed our expectations and measures of beauty?</li></ul><p>In the end, how do we know what to trust if we cannot trust what we see?</p>', 0000000001, '2011-12-13 19:09:00'),
