(00000000002220, 'Representation', 'A lesson looking into representation in the media.', '001,002,003,004,005,006,007', 'HTML', 'Other', 'Inspiration', 'ict,media,representation,truth,tok,bias,trust,pshe,pastoral,self,self image,health', '<h1>Representiation</h1><ul><li>Let''s start this lesson by seeing if any students understand the meaning of the word <strong>representation</strong> in media.</li><li>One way to think of representation is " the way that reality is portrayed or shown in magazines, TV, books,  film and music".</li><li>Do you think we can we trust the way that others represent reality? Should we?</li></ul><h2>Representation of Gender</h2><ul><li>Let''s take a look at this video, and discuss any ideas which is throws up.</li></ul> <p><iframe src="http://www.youtube.com/embed/8ap2xnMcvpw" frameborder="0" height="315" width="560"></iframe></p><ul><li>What does the above video tell us about the representation of women in the media?</li><li>Can you think of positive and negative gender representation of women? </li></ul><h2>Representation Examples</h2><ul><li>Now I would like you to work in pairs to find examples of representation on the web.</li><li>Links to items are to be placed into a shared Google Doc.</li><li>After 15 minutes I will get you back together to view and discuss the various materials found.</li></ul>', 0000000001, '2013-08-06 19:31:39'),
