INSERT INTO `gibbonRubricCell` (`gibbonRubricCellID`, `gibbonRubricID`, `gibbonRubricColumnID`, `gibbonRubricRowID`, `contents`) VALUES
(00000001793, 00000016, 000000103, 000000118, 'Able to find data by searching on key terms and then evaluating and refining search. Uses advanced search operators and functions, and searches by media other than text. Aware that some data is more reliable than others and uses and cites multiple sources. Understands that information quality affects reliability, and takes steps to identify and eliminate such data. Able to combine and refine data from multiple sources, using data sorting to improve efficiency.'),
(00000001792, 00000016, 000000102, 000000118, 'Able to find data by searching on key terms and then evaluating and refining search. Uses advanced search operators and functions. Aware that some data is more reliable than others and uses and cites multiple sources. Understands that information quality affects reliability, and takes steps to identify such data. Able to combine and refine data from multiple sources.'),
(00000001791, 00000016, 000000101, 000000118, 'Able to find data by searching on key terms and then evaluating and refining search. Aware that some data is more reliable than others and uses multiple sources. Understands that information quality affects reliability. Able to combine and refine data from multiple sources.'),
(00000001787, 00000016, 000000101, 000000117, 'Interested in using a computer to perform a range of tasks, and able to complete many some such tasks. Displays interest in a range of hardware and software components and how they work together to form a functioning system (e.g. desktop PC). Willing to handle hardware components and work to install and use system and application software. '),
(00000001788, 00000016, 000000102, 000000117, 'Actively uses a computer to perform a wide range of tasks and shows some understanding of when to work offline. Is able to complete all such tasks effectively.  Displays interest in a range of hardware, software and network components and how they work together to form a functioning system (e.g. desktop PC). Willing and able to handle hardware and network components and work to install and use system and application software. Able to make progress in tearing down and rebuilding a system. Selects appropriate tools for the task in hand. Able to use manuals, documentation and online guides to inform progress.'),
(00000001790, 00000016, 000000100, 000000118, 'Able to find data by searching on key terms and then refining search. Aware that some data is more reliable than others. Understands that information quality affects reliability. Able to combine data from multiple sources.'),
(00000001789, 00000016, 000000103, 000000117, 'Actively uses a computer to perform a wide range of tasks, but is discerning in understanding when to work offline. Is able to complete all such tasks effectively using multiple approaches.  Displays interest in a range of hardware, software and network components and how they work together to form a functioning system (e.g. desktop PC). Attempts troubleshooting when problems occur. Willing and able to handle hardware and network components and to install and use system and application software. Able to progress independently in tearing down and rebuilding a system. Selects appropriate tools for the task in hand and uses them carefully to achieve result. Able to use manuals, documentation and online guides to make progress and solve problems.'),
(00000001785, 00000016, 000000103, 000000116, 'Understands that text, images, music and video are protected under copyright law, and that products and ideas can be protected by patents. Able to find, use and attribute materials shared under Creative Commons, and apply such a license to their own work. Makes use of  other permissive licenses, similar to Creative Commons. Understands that copyright can both promote and hinder creativity through the mechanisms of reward and remix. Understands that free sharing of ideas is key to the development of knowledge and education. Is familiar with the consequences of plagiarism.'),
(00000001786, 00000016, 000000100, 000000117, 'Interesting in using a computer for some tasks. Displays interest in a range of hardware and software components within a functioning system (e.g. desktop PC). Willing to install and use application software. '),
(00000001782, 00000016, 000000100, 000000116, 'Understands that text, images, music and video are protected under copyright law. Able to find and use materials shared under Creative Commons licenses. Is familiar with the consequences of plagiarism.'),
(00000001783, 00000016, 000000101, 000000116, 'Understands that text, images, music and video are protected under copyright law. Able to find, use and attribute materials shared under Creative Commons licenses. Is familiar with the consequences of plagiarism.'),
(00000001784, 00000016, 000000102, 000000116, 'Understands that text, images, music and video are protected under copyright law. Able to find, use and attribute materials shared under Creative Commons, and apply such a license to their own work. Understands that copyright can both promote and hinder creativity. Is familiar with the consequences of plagiarism.'),
(00000001781, 00000016, 000000103, 000000115, 'Understands the distinction between the terms ICT and technology, and sees technology as anything man made. Understands that technology is central to and indivisible from modern living. Discusses their experience of using ICT and observations of its use in a variety of settings. Considers and discusses how ICT affects issues of personal safety, sustainability, individual behaviour, interpersonal relationships and societal change on a global scale. '),
(00000001778, 00000016, 000000100, 000000115, 'Understands that the terms ICT and technology have different meanings. Describes their use of ICT and how ICT is used in a variety of other settings. Considers how ICT affects issues of personal safety.'),
(00000001779, 00000016, 000000101, 000000115, 'Understands that the terms ICT and technology have different meanings. Compares their use of ICT with other, non-digital approaches. Considers the use of ICT in a variety of other settings, and how ICT affects issues of personal safety. '),
(00000001780, 00000016, 000000102, 000000115, 'Understands the distinction between the terms ICT and technology, and sees technology as anything man made. Understands that technology is central to modern living. Discusses their experience of using ICT, as well as its use in a variety of other settings. Considers how ICT affects issues of personal safety and sustainability.'),
(00000001776, 00000016, 000000102, 000000114, 'Able to work productively as an individual, in partnership or in a small group. Willing to contribute to a small or large group discussion. In group work, collaboration allows shared thinking and working, combined with individual work as needed.'),
(00000001777, 00000016, 000000103, 000000114, 'Able to work efficiently and productively as an individual, in partnership or in a small group. Willing to contribute to small or large group discussion. In group work, collaboration allows shared thinking, deciding and working, combined with individual work as needed. Group work is effective whether in the same space, or dispersed.'),
(00000001775, 00000016, 000000101, 000000114, 'Able to work productively as an individual, in partnership or in a small group. Willing to contribute to small group discussion.'),
(00000001770, 00000016, 000000100, 000000113, 'Focuses on thinking skills relating to remembering and understanding (see Blooms Taxonomy). Makes links in knowledge between two units. Considers the effects of phenomena.'),
(00000001771, 00000016, 000000101, 000000113, 'Demonstrates development of thinking skills relating to understanding, applying and analyzing (see Blooms Taxonomy). Makes links in knowledge between two units or subjects. Considers the causes and effects of phenomena.'),
(00000001772, 00000016, 000000102, 000000113, 'Demonstrates confidence in thinking skills relating to understanding, applying and analyzing, with development of evaluation and creating (see Blooms Taxonomy). Makes and actively utilises links in knowledge between two units or subjects. Considers the causes, effects and implication of phenomena.'),
(00000001773, 00000016, 000000103, 000000113, 'Demonstrates strong thinking skills in the highest orders of Blooms Taxonomy, including analyzing, evaluating and creating. Makes and actively utilises links in knowledge between two units or subjects. Considers the causes, effects and implications of phenomena. Attempts to make predictions using available information.'),
(00000001774, 00000016, 000000100, 000000114, 'Able to work productively as an individual, or in partnership. Willing to contribute to partnership discussion.'),
(00000001769, 00000016, 000000103, 000000112, 'Integrates a range of tools (e.g. WordPress), technologies (e.g. RSS) and languages (e,g, HTML, Scratch) to produce a fully functioning solution to a genuine problem for a real client. Demonstrates creativity and problem solving in design and implementation. Reviews completed solution to consider fitness for purpose, and uses conclusions to make suggestions to improve work.'),
(00000001767, 00000016, 000000101, 000000112, 'Uses a range of tools (e.g. WordPress), technologies (e.g. RSS) and languages (e,g, HTML, Scratch) to produce a partially functioning solution to a problem. Demonstrates creativity in design and implementation. Considers strengths and weaknesses of solution.'),
(00000001768, 00000016, 000000102, 000000112, 'Integrates a range of tools (e.g. WordPress), technologies (e.g. RSS) and languages (e,g, HTML, Scratch) to produce a fully functioning solution to a genuine problem. Demonstrates creativity and problem solving in design and implementation. Reviews solution to consider fitness for purpose.'),
(00000001766, 00000016, 000000100, 000000112, 'Uses a tool (e.g. WordPress) or technology to produce a partially functioning solution to a problem. Demonstrates creativity. Considers weaknesses of solution.'),
(00000001764, 00000016, 000000102, 000000111, 'Plan and test sequences of software instructions which solve a given problem, and understand the need to be precise when creating instructions. Understands instructions as steps to achieve an outcome, and that computers process instructions sequentially. Able to use and understand conditionals and loops.'),
(00000001765, 00000016, 000000103, 000000111, 'Plan, test and refine sequences of software instructions which efficiently solve a given problem, and understand the need to be precise when creating instructions. Understands instructions as steps to achieve an outcome, and that computers process instructions sequentially. Able to use and understand conditionals, loops and subroutines.'),
(00000001762, 00000016, 000000100, 000000111, 'Uses instruction sequences to control devices in order to achieve a desired outcome. Understands instructions as steps to achieve an outcome.'),
(00000001763, 00000016, 000000101, 000000111, 'Plan and test sequences of software instructions which solve a given problem. Understands instructions as steps to achieve an outcome, and that computers process instructions sequentially'),
(00000001761, 00000016, 000000103, 000000110, 'Able to understand abstract concepts (e.g., how the Internet works) and their importance. Able to relate concepts to each other. Identifies components, their function, importance and relationships, within a complex ICT system (e.g. desktop PC). Uses technical vocabulary and measures (MB, GHz). Understands some key file types that are used to store data, and is able to use appropriate file types, Able to convert between selected file types.'),
(00000001760, 00000016, 000000102, 000000110, 'Able to understand abstract concepts (e.g., how the Internet works). Identifies components, their function and importance, within a complex ICT system (e.g. desktop PC). Uses technical vocabulary and measures (MB, GHz). Understands some key file types that are used to store data, and is able to use appropriate file types,'),
(00000001758, 00000016, 000000100, 000000110, 'Attempting to understand abstract concepts (e.g., how the Internet works). Identifies components within a complex ICT system (e.g. desktop PC). Attempting to use technical vocabulary and measures (MB, GHz). '),
(00000001759, 00000016, 000000101, 000000110, 'Able to understand abstract concepts (e.g., how the Internet works). Identifies components, and their functions, within a complex ICT system (e.g. desktop PC). Uses technical vocabulary and measures (MB, GHz). Understands that data is stored in files of different types.'),
(00000001757, 00000016, 000000103, 000000109, 'Uses ICT to refine and share information in different forms, showing understanding sense of audience and purpose. Understands genre as an existing style guide for communication. Uses a digital portfolio to record and share academic development. Able to reflect in writing, considering what has been learned and its importance. Communicates clearly in academic and technical writing. Confident in talking about ICT in presentations and group discussions.'),
(00000001756, 00000016, 000000102, 000000109, 'Uses ICT to refine and share information in different forms, showing awareness of intended audience and purpose. Uses a digital portfolio to record and share academic development. Able to reflect in writing, considering what has been learned. Developing skills in academic and technical writing. Willing and able to talk about ICT in presentations and group discussions.'),
(00000001754, 00000016, 000000100, 000000109, 'Uses ICT to create, develop, manage and share their work. Uses a digital portfolio to store work. Understands some risks of communicating digitally.'),
(00000001755, 00000016, 000000101, 000000109, 'Uses ICT to present and share information in various forms, showing awareness of intended audience. Uses a digital portfolio to record and share academic development. Able to reflect in writing, considering what has been learned. Willing to talk about ICT in presentations and group discussions. Understands the risks associated with digital communication, including personal safety and information security.'),
(00000006152, 00000159, 000000793, 000000699, 'I am unsettled by challenge and resist leaving my comfort zone.'),
(00000006153, 00000159, 000000794, 000000699, 'I prefer to remain in my comfort zone and need to be encouraged to accept challenge and to be stretched.'),
(00000006154, 00000159, 000000795, 000000699, 'I accept challenge and being stretched in many areas, but I am content to remain in my comfort zone in some others.'),
(00000006155, 00000159, 000000796, 000000699, 'I welcome challenge and enjoy being stretched. I am eager to extend and build on my experience.'),
(00000006156, 00000159, 000000797, 000000699, 'I seek out challenge and prefer to be stretched whenever possible. I work actively to create opportunities to extend and deepen my experience.'),
(00000006157, 00000159, 000000793, 000000700, 'Faced with setback or failure, I am immediately discouraged and tend simply to give up.'),
(00000006158, 00000159, 000000794, 000000700, 'Faced with setback or failure, I am easily discouraged and need plentiful and ongoing support to persevere.'),
(00000006159, 00000159, 000000795, 000000700, 'Faced with setback or failure, I can persevere, though I may need some initial support and encouragement.'),
(00000006160, 00000159, 000000796, 000000700, 'Faced with setback or failure, I persevere. I bounce back from adversity, especially in areas where I am already confident.'),
(00000006161, 00000159, 000000797, 000000700, 'Faced with setback or failure, I am strong and robust. I demonstrate excellent bounce-back- ability, including in areas where I am not already confident.'),
(00000006162, 00000159, 000000793, 000000701, 'I find feedback hard and, when it is critical, sometimes impossible to accept. I reject and do not like receiving advice.'),
(00000006163, 00000159, 000000794, 000000701, 'I adopt a defensive or dismissive attitude to feedback. I often ignore or discount advice.'),
(00000006164, 00000159, 000000795, 000000701, 'I listen to feedback, but do not always act on it. I sometimes follow good advice.'),
(00000006165, 00000159, 000000796, 000000701, 'I engage with feedback and respond to it with acceptance. I take and follow good advice.'),
(00000006166, 00000159, 000000797, 000000701, 'I happily engage with feedback with an open mind and am able to respond readily. I seek and welcome good advice.'),
(00000006167, 00000159, 000000793, 000000702, 'I am disorganised and chaotic.\r\nI have few, if any, strategies for managing or prioritizing my response to multiple demands.'),
(00000006168, 00000159, 000000794, 000000702, 'I am poorly organised. I have some strategies for managing and responding to multiple demands, but they are either inadequate or poorly used. '),
(00000006169, 00000159, 000000795, 000000702, 'I can be organized with support. I have some strategies to manage and respond to multiple demands, but need guidance in using them well.'),
(00000006170, 00000159, 000000796, 000000702, 'I am reliably self-organised. I have sufficient strategies to manage and respond to multiple demands, with few and infrequent lapses.'),
(00000006171, 00000159, 000000797, 000000702, 'I organize myself very well. I have flexible and dependable strategies that allow me to manage multiple demands and anticipate potential change.'),
(00000006172, 00000159, 000000793, 000000703, 'I get stuck easily and do not seek help to move forward. I am prone to prolonged inactivity in class while awaiting help.'),
(00000006173, 00000159, 000000794, 000000703, 'I lack resourcefulness and tend to require teacher input to move on once stuck.'),
(00000006174, 00000159, 000000795, 000000703, 'I can be resourceful. I demonstrate a limited number of strategies to move on when stuck. I use other students to offer possible solutions.'),
(00000006175, 00000159, 000000796, 000000703, 'I am resourceful. I demonstrate a number of strategies to move on when stuck, including seeking support from the teacher and other students, but also changing my approach to tasks when appropriate.'),
(00000006176, 00000159, 000000797, 000000703, 'I am highly resourceful. I demonstrate a wide repertoire of strategies to move on when stuck, including lateral thinking, self-generated research and intelligent trial and error when appropriate.'),
(00000006177, 00000159, 000000793, 000000704, 'I need prompting to begin tasks. I am easily distracted and not able to pay sustained attention. I show little evidence of internal motivation.'),
(00000006178, 00000159, 000000794, 000000704, 'I sometimes need prompting to begin tasks. I am on occasions distracted, though usually regain my focus when reminded. When motivated by external factors, I show some care for the quality of my work.'),
(00000006179, 00000159, 000000795, 000000704, 'I begin tasks promptly.\r\nI stay on task with no or few reminders. When motivated by external factors, I care for the quality of my work.'),
(00000006180, 00000159, 000000796, 000000704, 'I am a self-starter. I stay on task. I care about the quality of my work and I am internally motivated.'),
(00000006181, 00000159, 000000797, 000000704, 'I am a self-starter, who stays on task and is capable of achieving flow. I care about the quality of my work and I am internally motivated.'),
(00000006182, 00000159, 000000793, 000000705, 'I find group work very challenging and will often only work with select friends. On occasions I am disruptive and keep others from working. I am sometimes unaware of or unconcerned about my behaviour.'),
(00000006183, 00000159, 000000794, 000000705, 'I need encouragement to work in a group and am happiest working with friends. I tend only to work well in groups when prompted or assisted.'),
(00000006184, 00000159, 000000795, 000000705, 'I am able to work in a group and cooperate well with other group members. I usually play an effective role within a group and appreciate my responsibilities.'),
(00000006185, 00000159, 000000796, 000000705, 'I am happy to work in a group and facilitate cooperation. I am loyal, play an effective role and take responsibility.'),
(00000006186, 00000159, 000000797, 000000705, 'I flourish when working in a group and making things happen. I can be versatile, playing a range of roles equally well. I am loyal and take responsibility.'),
(00000006187, 00000159, 000000793, 000000706, 'I demonstrate a single way of relating to others and cannot shift between ego states, even when desired or advisable.'),
(00000006188, 00000159, 000000794, 000000706, 'I have a preferred way of relating to others and find it very hard to shift between ego states, even when desired or advisable.'),
(00000006189, 00000159, 000000795, 000000706, 'I have a limited range of ways of relating to others, shifting with effort between ego states when desired and advisable.'),
(00000006190, 00000159, 000000796, 000000706, 'I have a range of ways of relating to others and can typically shift ego states when desired or advisable.'),
(00000006191, 00000159, 000000797, 000000706, 'I am truly versatile in the ways I relate to others and can shift ego states reliably and mindfully.');
